webpackJsonp([0xefbd22452777],{1072:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Web technologies are well suited for developing rich applications for the automotive market. Enact makes it easy for large organizations to implement performant, reliable and robust applications for automotive. Its features include:</p>\n<ul>\n<li>A comprehensive component set — begin creating apps immediately</li>\n<li>Built-in theming and skinning — adjust look and feel to meet developer or end-user needs</li>\n<li>Cross/Multi-platform support — share code among embedded, mobile and web</li>\n<li>Focus management (5-way (directional), 3-way (knob), touch) — no special code required to support common user interfaces</li>\n<li>Internationalization (i18n) — easily support localization</li>\n<li>Accessibility (a11y) — easily add text-to-speech or voice control</li>\n<li>Support for V8 Snapshot — enables quick launch of applications</li>\n<li>Resolution independence — supports different screen sizes</li>\n</ul>\n<p>Best of all, it is open Source and supported by LG.</p>\n<h2 id="successes"><a href="#successes" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Successes</h2>\n<h3 id="webos-auto"><a href="#webos-auto" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>webOS Auto</h3>\n<p>Enact will power the reference apps for the forthcoming webOS Auto distribution. Using these reference apps and the power of webOS Auto, OEMs and others can quickly create compelling automotive applications.</p>\n<h3 id="automotive-grade-linux"><a href="#automotive-grade-linux" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Automotive Grade Linux</h3>\n<p>Enact powered the LG automotive UI at the <a href="https://www.automotivelinux.org/">Automotive Grade Linux</a> booth during CES. This demonstration showcased the power and features that Enact can deliver when paired up with <a href="https://github.com/webosose/wam">Web App Manager (WAM)</a> on AGL.</p>\n<p><div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 50%; position: relative; height: 0; overflow: hidden;"\n          >\n            <div><iframe src="https://www.youtube.com/embed/XUEGQxcnCik" style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe></div>\n          </div>\n          </div></p>',frontmatter:{title:"Enact for Automotive",github:"https://github.com/enactjs/docs/blob/develop/src/pages/uses/automotive/index.md"}},allMarkdownRemark:{edges:[{node:{fields:{slug:"/uses/automotive/"},frontmatter:{title:"Enact for Automotive"}}},{node:{fields:{slug:"/uses/robotics/"},frontmatter:{title:"Enact for Robotics"}}},{node:{fields:{slug:"/uses/"},frontmatter:{title:"Use Cases"}}}]},site:{siteMetadata:{title:"Enact"}},docsPages:{edges:[{node:{path:"/docs/developer-guide/",context:{title:null}}},{node:{path:"/docs/developer-tools/",context:{title:null}}},{node:{path:"/docs/modules/",context:{title:null}}},{node:{path:"/docs/tutorials/",context:{title:null}}}]},jsMetadata:{edges:[{node:{fields:{slug:"/docs/developer-guide/"},fileAbsolutePath:"/home/goun/Source/enact-docs/src/pages/docs/developer-guide/index.js",frontmatter:{title:"Developer Guide"}}},{node:{fields:{slug:"/docs/developer-tools/"},fileAbsolutePath:"/home/goun/Source/enact-docs/src/pages/docs/developer-tools/index.js",frontmatter:{title:"Developer Tools"}}},{node:{fields:{slug:"/docs/modules/"},fileAbsolutePath:"/home/goun/Source/enact-docs/src/pages/docs/modules/index.js",frontmatter:{title:"API Libraries"}}},{node:{fields:{slug:"/docs/tutorials/"},fileAbsolutePath:"/home/goun/Source/enact-docs/src/pages/docs/tutorials/index.js",frontmatter:{title:"Tutorials"}}}]}},pathContext:{slug:"/uses/automotive/",title:"Enact for Automotive",parentRegex:"/\\/uses(\\/[^/]*)?\\/$/"}}}});